// MenuPage.js
import React, { useState } from 'react';
import './MenuPage.css';

const MenuPage = () => {
  const [items, setItems] = useState([
    { id: 1, price: 100, description: 'pizza', imageUrl: 'data:image/jpeg;base64,' },
    { id: 2, price: 150, description: 'Burger', imageUrl: 'data:image/jpeg;base64,' },
    { id: 3, price: 200, description: 'Meal', imageUrl: 'data:image/jpeg;base64,' },
  ]);

  const [selectedItems, setSelectedItems] = useState([]);
  const [totalPrice, setTotalPrice] = useState(0);

  const handleBuyClick = () => {
    const calculatedTotalPrice = selectedItems.reduce((total, item) => total + item.price, 0);
    setTotalPrice(calculatedTotalPrice);
  };

  const handleItemClick = (item) => {
    const index = selectedItems.findIndex((selectedItem) => selectedItem.id === item.id);

    if (index === -1) {
      // Add the item to selectedItems if not already selected
      setSelectedItems([...selectedItems, item]);
    } else {
      // Remove the item from selectedItems if already selected
      const updatedSelectedItems = [...selectedItems];
      updatedSelectedItems.splice(index, 1);
      setSelectedItems(updatedSelectedItems);
    }
  };

  return (
    <div className="menu-container">
      <h1>Menu</h1>
      <nav>
          <a href="Website">Home</a>
          <a href="LoginPage">Login</a>
          <a href="SignupPage">Booking</a>
        </nav>
        <br/>
        <br/>
        <br/>
      <div className="menu-items">
        {items.map((item) => (
          <div key={item.id} className={`menu-item ${selectedItems.some((i) => i.id === item.id) ? 'selected' : ''}`}>
            <img src={item.imageUrl} alt={`Item ${item.id}`} />
            <h3>{item.name}</h3>
            <p>{item.description}</p>
            <button onClick={() => handleItemClick(item)}>
              {selectedItems.some((i) => i.id === item.id) ? 'Remove' : 'Add to Cart'}
            </button>
          </div>
        ))}
      </div>
      <br/>
      
      <br/>
      <button className="buy-button" onClick={handleBuyClick}>Buy </button>
      {totalPrice > 0 && (
        <div className="total-price">
          <p>Total Price: ${totalPrice}</p>
        </div>
      )}
    </div>
  );
};

export default MenuPage;
